import React from 'react'
import {BrowserRouter, Route, Link} from 'react-router-dom'

import NoteList from './component/notes/List'
import NoteShow from './component/notes/Show'
class App extends React.Component{
    render(){
        return(
            <BrowserRouter>
                <div>
                    <h1>My Note App</h1>
                    <Link to='/notes'>List Notes</Link>

                    {/* Route Matcher */}
                    <Route path='/notes' component={NoteList} />
                    <Route path='/notes/:id' component={NoteShow} />
                    </div>
            </BrowserRouter>
            )
    }
}
export default App
